import React from 'react';
  
const About = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Left',
        alignItems: 'Right',
        height: '100vh',
        backgroundColor: '#000080'
      }}
    >
        <p style={{color:'white'}}>
      <h1>To be Completed</h1><br></br>
      <h2>Top Right Logo</h2>
      <h2>Explore Button Centered</h2>
      <h2>Background Image</h2>
      </p>
    </div>
  );
};
  
export default About;
